// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AccessControl {
    struct AccessRequest {
        uint256 id;
        address doctor;
        address patient;
        string reason;
        uint256 requestDate;
        uint256 duration; // in hours
        string status; // pending, approved, rejected, expired
        uint256 approvalDate;
    }

    uint256 private requestCounter = 0;
    mapping(uint256 => AccessRequest) public requests;
    mapping(address => uint256[]) public patientRequests;
    mapping(address => mapping(address => bool)) public activeAccess;
    mapping(address => uint256) public accessExpiration;

    event AccessRequested(uint256 indexed requestId, address indexed doctor, address indexed patient);
    event AccessGranted(uint256 indexed requestId, address indexed doctor, address indexed patient);
    event AccessDenied(uint256 indexed requestId, address indexed doctor, address indexed patient);
    event AccessExpired(address indexed doctor, address indexed patient);

    modifier onlyPatient(uint256 requestId) {
        require(requests[requestId].patient == msg.sender, "Only patient can respond");
        _;
    }

    function createAccessRequest(
        address patient,
        string memory reason,
        uint256 duration
    ) external returns (uint256) {
        require(duration > 0, "Duration must be positive");

        requestCounter++;

        AccessRequest memory newRequest = AccessRequest({
            id: requestCounter,
            doctor: msg.sender,
            patient: patient,
            reason: reason,
            requestDate: block.timestamp,
            duration: duration,
            status: "pending",
            approvalDate: 0
        });

        requests[requestCounter] = newRequest;
        patientRequests[patient].push(requestCounter);

        emit AccessRequested(requestCounter, msg.sender, patient);

        return requestCounter;
    }

    function respondToAccessRequest(uint256 requestId, bool approved) 
        external 
        onlyPatient(requestId) 
    {
        AccessRequest storage request = requests[requestId];
        require(bytes(request.status).length > 0, "Request does not exist");
        require(keccak256(bytes(request.status)) == keccak256(bytes("pending")), "Request already processed");

        if (approved) {
            request.status = "approved";
            request.approvalDate = block.timestamp;
            activeAccess[request.doctor][request.patient] = true;
            accessExpiration[request.doctor] = block.timestamp + (request.duration * 1 hours);
            emit AccessGranted(requestId, request.doctor, request.patient);
        } else {
            request.status = "rejected";
            emit AccessDenied(requestId, request.doctor, request.patient);
        }
    }

    function checkAccess(address doctor, address patient) external view returns (bool) {
        if (!activeAccess[doctor][patient]) {
            return false;
        }

        if (block.timestamp > accessExpiration[doctor]) {
            return false;
        }

        return true;
    }

    function getAccessRequests(address patient) external view returns (AccessRequest[] memory) {
        uint256[] memory requestIds = patientRequests[patient];
        AccessRequest[] memory result = new AccessRequest[](requestIds.length);

        for (uint256 i = 0; i < requestIds.length; i++) {
            result[i] = requests[requestIds[i]];
        }

        return result;
    }

    function revokeAccess(address doctor) external {
        require(activeAccess[doctor][msg.sender], "No active access to revoke");
        activeAccess[doctor][msg.sender] = false;
        accessExpiration[doctor] = 0;
        emit AccessExpired(doctor, msg.sender);
    }
}
